import React from 'react'
import {Row, Col} from 'react-bootstrap'
import HomePlace from '../Places/HomePlace'
import HomeScreenCard from './HomeScreenCard'
import India from '../Places/India'
const Country = [
    {
        '_id':'1',
        'name':'india'
    },
    {
        '_id':'2',
        'name':'Chine'
    },
    {
        '_id':'3',
        'name':'America'
    },
    {
        '_id':'4',
        'name':'London'
    },
]

const HomeScreenCardItem = ({match}) => {
    const CountryName = Country.find((c)=>c._id === match.par)
    return (
        <>
            <Row className="home-screen-container my-3 p-3 w-100" >
                {
                    India.map((homeplace)=>(
                        <Col>
                            <HomeScreenCard
                                homeplace={homeplace}
                            />
                        </Col>
                    ))
                }
            </Row>
        </>
    )
}

export default HomeScreenCardItem
